import React, { useState } from 'react';
import axios from 'axios';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './LoanForm.css'; // Ensure this path is correct
import { useNavigate } from 'react-router-dom';

const LoanForm = () => {
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: 0,
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: '',
  });

  const [loanFields, setLoanFields] = useState([]);

  const bankOptions = [
    'State Bank of India',
    'HDFC Bank',
    'ICICI Bank',
    // ... other options
  ];

  const jobTitleOptions = [
    'Software Engineer',
    'Data Analyst',
    'Product Manager',
    // ... other options
  ];

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Owns_House' && value === 'Yes') {
        return {
          ...prevFormData,
          [name]: value,
          Rent_Amount: '' // Clear Rent_Amount when Owns_House is "Yes"
        };
      }
      if (name === 'Number_of_Loans') {
        const numLoans = parseInt(value, 10);
        const newLoanFields = Array.from({ length: numLoans }, (_, index) => ({
          EMI: formData[`Loan_${index + 1}_EMI`] || '',
          Tenure: formData[`Loan_${index + 1}_Tenure`] || '',
        }));
        setLoanFields(newLoanFields);
        return {
          ...prevFormData,
          [name]: value
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const handleLoanFieldChange = (index, field, value) => {
    const updatedLoanFields = [...loanFields];
    updatedLoanFields[index] = {
      ...updatedLoanFields[index],
      [field]: value
    };
    setLoanFields(updatedLoanFields);

    // Update formData with new values
    setFormData(prevFormData => ({
      ...prevFormData,
      [`Loan_${index + 1}_${field}`]: value
    }));
  };

  const validateForm = () => {
    const errors = [];
    for (const key in formData) {
      if (formData[key].trim() === '') {
        errors.push(key);
      }
    }
    if (errors.length > 0) {
      return `Please fill out the following fields: ${errors.join(', ')}`;
    }
    return '';
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const validationError = validateForm();
    if (validationError) {
      toast.error(validationError);
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', formData);
      const data = response.data;
      console.log('Prediction Results:', response.data);
      toast.success('Loan application submitted successfully!');
      navigate('/result', { state: { resultData: data } });
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
      toast.error('An error occurred while submitting the application.');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="form-all">
      <ToastContainer />
      {/* Personal Information Section */}
      <div className="form-section">
        <h2>Personal Information</h2>
        {/* ... existing personal information fields */}
      </div>

      {/* Financial Information Section */}
      <div className="form-section">
        <h2>Financial Information</h2>
        {/* ... existing financial information fields */}
      </div>

      {/* Employment Information Section */}
      <div className="form-section">
        <h2>Employment Information</h2>
        {/* ... existing employment information fields */}
      </div>

      {/* Mall Details Section */}
      <div className="form-section">
        <h2>Mall Details</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Mall Visits Per Month
              <input
                type="number"
                name="Mall_Visits_Per_Month"
                value={formData.Mall_Visits_Per_Month}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Average Mall Spend
              <input
                type="number"
                name="Mall_Spend_Average"
                value={formData.Mall_Spend_Average}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>

      {/* Loan Details Section */}
      <div className="form-section">
        <h2>Loan Details</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Number of Loans
              <input
                type="number"
                name="Number_of_Loans"
                value={formData.Number_of_Loans}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        {loanFields.map((loan, index) => (
          <div className="form-row" key={index}>
            <div className="form-line">
              <label className="form-label">
                Loan {index + 1} EMI
                <input
                  type="number"
                  name={`Loan_${index + 1}_EMI`}
                  value={loan.EMI}
                  onChange={(e) => handleLoanFieldChange(index, 'EMI', e.target.value)}
                  min="0"
                  className="form-textbox"
                />
              </label>
            </div>
            <div className="form-line">
              <label className="form-label">
                Loan {index + 1} Tenure
                <input
                  type="number"
                  name={`Loan_${index + 1}_Tenure`}
                  value={loan.Tenure}
                  onChange={(e) => handleLoanFieldChange(index, 'Tenure', e.target.value)}
                  min="0"
                  className="form-textbox"
                />
              </label>
            </div>
          </div>
        ))}
      </div>

      {/* Bank and Credit Information Section */}
      <div className="form-section">
        <h2>Bank and Credit Information</h2>
        {/* ... existing bank and credit information fields */}
      </div>

      {/* Submit Button */}
      <div className="form-row">
        <button type="submit" className="form-button">Submit</button>
      </div>
    </form>
  );
};

export default LoanForm;
